import { Component } from 'react'
import Navigation from '../components/Navigation'
import Api from '../api/Api'

interface State {
    params: {
        skip: number,
        take: number
    }
    data: any
}

class Index extends Component<any, State> {

    constructor(props: any) {
        super(props)
        this.state = {
            params: {
                skip: 0,
                take: 4
            },
            data: []
        }

        this.apiData()
    }

    apiData = async () => {
        const api = new Api({})
        const data = await api.index(this.state.params)
        return this.setState({ data })
    }

    render = (): JSX.Element => {

        console.log(this.state.data)

        return (
            <>
                <Navigation />
                <div className="App">
                    <h1>Index</h1>
                </div>
            </>
        )
    }
}

export default Index
